pragma solidity ^0.8.6;

import "@openzeppelin/contracts/access/Ownable.sol";


contract Random is Ownable {
    uint256 private _seed;

    constructor(uint seed)    {
        if (seed > 0) {
            setSeed(seed);
        }
    }

    function setSeed(uint256 _newSeed) public onlyOwner {
        _seed = _newSeed;
    }

    function getRandomNumber(uint moreRandom) external returns (uint256) {
        uint256 randomNumber = uint256(keccak256(abi.encodePacked(blockhash(block.number - 1), tx.origin, _seed, moreRandom)));
        _seed = randomNumber;
        return randomNumber;
    }


}
